// src/components/AboutSection.js
import React from 'react';
import './AboutSection.css'; // Untuk styling tambahan

const AboutSection = () => {
    return (
        <section id="about" className="about">
            <div className="about-container">
                <div className="about-image">
                    <img src="assets/gambar/rino.JGP" alt="Gambar Rino" />
                </div>
                <div className="about-text">
                    <h2>Tentang Saya</h2>
                    <p>
                        Saya adalah seorang pengembang web dengan pengalaman dalam membangun aplikasi menggunakan React.
                        Saya memiliki keterampilan dalam desain UI/UX, pengembangan front-end, dan pemecahan masalah.
                    </p>
                </div>
            </div>
        </section>
    );
};

export default AboutSection;
